export const getMockTreeData = async (str) =>
{
  let result=null
  switch (str) {
    case '/GetBranches':
      result = branches
      break
    case '/GetVoltLevels/branch/1':
      result = voltLevels1
      break
    case '/GetVoltLevels/branch/2':
      result = voltLevels2
      break
    case '/GetVoltLevels/branch/3':
      result =  voltLevels3
      break
    case '/GetSubstations/branch/1/voltLevel/2':
      result =  substations1
      break
    case '/GetSubstations/branch/1/voltLevel/3':
      result =  substations2
      break
    case '/GetSubstations/branch/2/voltLevel/5':
      result =  substations6
      break
    case '/GetSubstations/branch/3/voltLevel/1':
      result = substations3
      break
    case '/GetSubstations/branch/3/voltLevel/2':
      result =  substations4
      break
    case '/GetSubstations/branch/3/voltLevel/3':
      result = substations5
      break
    default:
      break
    }
    if(result)
    {
      return new Promise((resolve, reject) =>{
        resolve(result)
        //reject('error')
      })
    }
    else
    {
      return new Promise((resolve, reject) =>{
        //resolve(result)
        reject('api tree error')
      })
    }
}
